import React from 'react';
import logo from './logo.svg';
import './App.css';
import Header from './component/header';
import { Container, Row, Col } from 'react-bootstrap';

function App() {
  return (
    <Container fluid='sm'>
      <Header />
      <Row>
        <Col md={4} xs={6}>md=4</Col>
        <Col md={{ span: 4, offset: 4 }} xs={6}>{`md={{ span: 4, offset: 4 }}`}</Col>
      </Row>
    </Container>
  );
}

export default App;
